import React from "react";
import { useSelector } from "react-redux";

export const List = () => {
  const todos = useSelector((state) => {
    return state.todos;
  });
  return (
    <div>
      {todos.map((todo) => {
        return (
          <div
            style={{
              border: "1px solid black",
              margin: "10px",
            }}
            key={todo.id}
          >
            {todo.id} <br />
            {todo.title} <br />
            {todo.body} <br />
            {todo.isDone.toString()} <br />
          </div>
        );
      })}
    </div>
  );
};

export default List;
